import React from 'react';
import Header from './../components/Header';
import Footer from './../components/Footer';


//Layouts



const MainLayout = props => {
    return (
        <div className = 'fullHeight'>
            <Header {...props} />
            <div className = 'main'>
                {props.children}
            </div>
            <Footer />
        </div >        
    );
};

export default MainLayout;
